  Code = "class Solution:\n    def mostFrequentEven(self, nums: List[int]) -> int:\n        nums.sort()\n        max_freq, max_freq_num = 0, -1\n        cur_freq = 0\n        prev = -1\n        for num in nums:\n            if num % 2 != 0:\n                continue\n            if num == prev:\n                cur_freq += 1\n            else:\n                cur_freq, prev = 1, num\n            if cur_freq > max_freq:\n                max_freq, max_freq_num = cur_freq, num\n        return max_freq_num"
